// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;
pragma experimental ABIEncoderV2;

import "./User.sol";
import "./OrderRequestInfo.sol";
import "./OrderInfo.sol";

contract Order {
    User user;

    constructor(address _userAddress) {
        user = User(_userAddress);
    }

    modifier onlyDistributor() {
        require(user.getUserRole(msg.sender) == 2, "ODCC");
        _;
    }

    modifier onlyRetailer() {
        require(user.getUserRole(msg.sender) == 3, "ORCC");
        _;
    }

    //Hold all the orders submitted by Retailer
    mapping(address => address[]) RetailerOrderRequests;
    //Hold all the orders assigned to distributor
    mapping(address => address[]) DistributorOrderRequests;

    //Event to capture & dispatch order request details
    event OrderRequestEvt(address indexed orderRequestId, uint256 status);

    //Method will submit product request order by retailer to distributor.
    //@param _productName String Name of product
    //@param _productDesc String Desc of product
    //@param _manufacturerDetail String Manufacturer detail
    //@param _notes String notes
    //@param _distributor Address Distributor address
    //@param _retailer Address retailer store address
    function submitOrder(
        string memory _productName,
        string memory _productDesc,
        string memory _manufacturerDetail,
        uint256 _quantity,
        string memory _notes,
        address _distributor
    ) public onlyRetailer {
        OrderRequestInfo orderRequest = new OrderRequestInfo(
            _productName,
            _productDesc,
            _manufacturerDetail,
            _quantity,
            _notes,
            _distributor,
            msg.sender
        );
        RetailerOrderRequests[msg.sender].push(address(orderRequest));
        DistributorOrderRequests[_distributor].push(address(orderRequest));
        //dispatching event
        emit OrderRequestEvt(
            address(orderRequest),
            OrderRequestInfo(address(orderRequest)).getOrderRequestStatus()
        );
    }

    //Reject/Approve order received from retailer
    function updateOrder(
        address _orderRequestId,
        string memory _reason,
        bool isApprove
    ) public onlyDistributor {
        if (isApprove) {
            if (OrderRequestInfo(address(_orderRequestId)).accept()) {
                //dispatching event
                emit OrderRequestEvt(
                    _orderRequestId,
                    OrderRequestInfo(_orderRequestId).getOrderRequestStatus()
                );
            }
        } else {
            if (OrderRequestInfo(address(_orderRequestId)).reject(_reason)) {
                //dispatching event
                emit OrderRequestEvt(
                    _orderRequestId,
                    OrderRequestInfo(_orderRequestId).getOrderRequestStatus()
                );
            }
        }
    }

    //Get list of retailer submitted orders
    function getRetailerSubmittedOrders(address _retailer)
        public
        view
        returns (address[] memory)
    {
        return RetailerOrderRequests[_retailer];
    }

    //Get list of distributor assigned orders
    function getDistributorAssignedOrders(address _distributor)
        public
        view
        returns (address[] memory)
    {
        return DistributorOrderRequests[_distributor];
    }

    //Get retailer submitted orders count
    function getRetailerSubmittedOrderCount(address _retailer)
        public
        view
        returns (uint256)
    {
        return RetailerOrderRequests[_retailer].length;
    }

    //Get distributor assigned orders count
    function getDistributorAssignedOrderCount(address _distributor)
        public
        view
        returns (uint256)
    {
        return DistributorOrderRequests[_distributor].length;
    }

    //Retrieve order details
    //@param _orderRequestId Address order Id
    function getOrderDetails(address _orderRequestId)
        public
        view
        returns (OrderInfo memory)
    {
        return OrderRequestInfo(_orderRequestId).getOrderRequestInfo();
    }
}
